import React from 'react'
import NSMenuItem from '../components/NSMenuItem/index'
import Add from '@material-ui/icons/Add';
import Subtract from '@material-ui/icons/Subtract';
import { action } from '@storybook/addon-actions';

export default {
  title: 'New Story Menu Item',
  component: NSMenuItem
}

export function MenuItemContainer() {

  return (
    <div>
      <h3>Menu Item</h3>
        <p>
          <NSMenuItem icon={Add} text='Test' handleItemClick={action('clicked')} />
          <NSMenuItem icon={Subtract} text='Test2' handleItemClick={action('clicked')} />
        </p>

    </div>
  )
}
